$(document).ready(function(){
  $('#notification a').click(function() {
    var notification =  $("#notification_id").val();
    alert(notification);
    $.ajax({
      type: 'PUT',
      url: '/sender_recipients/' + notification,
      data: { notification: notification }
    });
  })
})
